    false,nt"url": null,nt"notes": "This annual narrative report for Blackwater,
    Susquehanna, and Mason Neck NWRs outlines Refuge accomplishments during the 1969
    calendar year. The report begins by summarizing the weather conditions, habitat
    conditions, water conditions, and food and cover conditions during the year. Wildlife-
    including migratory birds, upland game birds, big game animals, furbearers, predators,
    rodents, mammals, raptors, fish, and reptiles- is also covered. The Refuge development
    and maintenance section discusses physical developments, plantings, collections
    and receipts, vegetation control, prescribed burning, and wildfires. Resource management
    is outlined; topics include fur harvesting and timber removal. A progress report
    on field investigations and applied research is also provided. The public relations
    section of the report describes recreational uses, Refuge visitors, Refuge participation,
    violations, and safety. N-R forms and photographs are attached.",nt"owner_org":
